import React from 'react';



const Coba = (props) => {
    return (
        <h1> Hai {props.coba} </h1>
    );
}

const RegisterForm = () => {

    
    return (

        <div>
            <React.Fragment>
                <Coba coba="Sofia"/>
                <h2>Daftar Dulu YUks</h2>
            </React.Fragment>            
        </div>
    )
}

export default RegisterForm;
